package com.example.uiexam.fragments

import android.os.Bundle
import androidx.fragment.app.Fragment
import android.view.LayoutInflater
import android.view.View
import android.view.ViewGroup
import androidx.recyclerview.widget.LinearLayoutManager
import androidx.recyclerview.widget.RecyclerView
import com.example.uiexam.R
import com.example.uiexam.adapters.CollectionAdapter
import com.example.uiexam.model.Collection

class CollectionsFragment : Fragment() {

    private lateinit var rvCollection: RecyclerView
    private lateinit var collectionAdapter: CollectionAdapter

    override fun onCreateView(
        inflater: LayoutInflater, container: ViewGroup?,
        savedInstanceState: Bundle?
    ): View? {
        // Inflate the layout for this fragment
        return inflater.inflate(R.layout.fragment_collections, container, false)
    }

    override fun onViewCreated(view: View, savedInstanceState: Bundle?) {
        super.onViewCreated(view, savedInstanceState)

        rvCollection = view.findViewById(R.id.rvCollection)
        rvCollection.layoutManager = LinearLayoutManager(requireActivity())

        refreshAdapter(getAllCollections())
    }

    private fun refreshAdapter(allCollections: java.util.ArrayList<Collection>) {
        collectionAdapter = CollectionAdapter(requireActivity(), allCollections)
        rvCollection.adapter = collectionAdapter
    }

    private fun getAllCollections(): ArrayList<Collection> {
        return ArrayList<Collection>().apply {
            this.add(Collection("data:image/jpeg;base64,", "Hotels"))
            this.add(Collection("data:image/jpeg;base64,","Restaurants"))
            this.add(Collection("data:image/jpeg;base64,","Cars"))
            this.add(Collection("data:image/jpeg;base64,", "Jobs"))
            this.add(Collection("data:image/jpeg;base64,", "Furniture"))
            this.add(Collection("data:image/jpeg;base64,", "Phones"))
            this.add(Collection("data:image/jpeg;base64,", "Watches"))
            this.add(Collection("data:image/jpeg;base64,", "Eateries"))
        }
    }
}